    return (
      <div style={{ backgroundColor: "#2d2b46" }}>
        <div className="container">
          <div className="row">
            <div className="col-12 col-md-9">
              <h2 className="h1 lead font-weight-bold"> call to action</h2>
              <p className="text-white">
                {" "}
                Lorem ipsum dolor, sit amet consectetur adipisicing elit. Optio
                temporibus, culpa quaerat incidunt qui fugiat nulla
                exercitationem
              </p>
            </div>
            <div className="col-12 col-md-3">
              <button
                style={{ backgroundColor: "transparent" }}
                className="d-block py-auto my-auto border-2 border-white text-capitalize text-white lead"
              >
                call to action
              </button>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default CallToAction;
